import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.css";
import { library } from "@fortawesome/fontawesome-svg-core";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faGithub } from "@fortawesome/free-brands-svg-icons";
import { faLinkedin } from "@fortawesome/free-brands-svg-icons";

import { faMailchimp } from "@fortawesome/free-brands-svg-icons";

import { IconName } from "@fortawesome/fontawesome-svg-core";

library.add(faMailchimp);

class Contact extends Component {
  state = {};
  render() {
    return (
      <div className="row">
        <div className="col-sm-12 col-md-5 d-flex align-items-center">
          <div className="row">
            <div className="row mb-5">
              <h1 className="col-12">CONTACT</h1>
            </div>
            <div className="row mb-4">
              <h4 className="col-12">You Got A Problem To Solve ?</h4>
            </div>
            <div className="row mb-4">
              <p className="col-12 text-secondary">
                Get your space suit ready and tell me your ideas to develop your
                dream application.
              </p>
            </div>
            <div className="row ms-1">
              <FontAwesomeIcon icon={["fab", "mailbox"]} />
              <span>messey.bilal@gmail.com</span>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Contact;
